import styled from 'styled-components';

const ProductsMainPageStyles = styled.section`
  position: relative;
  margin-top: 6rem;
  background: lightgray;
  margin-bottom: 10rem;

  h2 {
    font-size: 3.5rem;
    text-transform: uppercase;
    font-weight: 400;
    color: darkblue;
    padding-left: 5rem;
  }

  .item-title {

  }

  .embla__slide {
    position: relative;
    min-width: 25%;
    @media (max-width: 828px) {
      min-width: 50%;
    }
  }
`;

export { ProductsMainPageStyles };
